import {
    MDBRow,
    MDBCol,
    MDBBtn,
    MDBInputGroup,
    MDBSwitch,
} from 'mdb-react-ui-kit';

const Filter = () => {
    return (
        <MDBRow tag="form" className="row-cols-lg-auto g-3 align-items-center">
            <MDBCol size="12">
                <MDBSwitch />
            </MDBCol>
            <MDBCol size="12">
                <MDBSwitch label="Remember me" />
            </MDBCol>
            <MDBCol size="12">
                <MDBBtn type="submit">Submit</MDBBtn>
            </MDBCol>
        </MDBRow>
    );
};

export default Filter;
